import React from "react";

const Day24 = (props) => {
  return (
    <div className="day">
      <h2>May 24</h2>
      <h3>Barcelona Art and City</h3>

      <div>
        <p>Today we will be touring through some of the famous cultural and historical landmarks of Barcelona</p>
        <p>We will be meeting at the Sagrada Familia at 10AM today to start things off. This famous cathedral has been under construction since 18--</p>
      </div>
    </div>
  );
};

export default Day24;
